WHERE id BETWEEN 2 AND 10;

-- 6. Agrego el segundo nivel

ALTER TABLE users AUTO_INCREMENT = 11;

INSERT INTO users (fullname, host)
SELECT fullname, FLOOR(RAND()*(10-2+1)+2) 
FROM fake
WHERE id BETWEEN 11 AND 3000;

