    DECLARE done INT DEFAULT FALSE;
    DECLARE lista_cursor CURSOR FOR
        SELECT CAST(id AS UNSIGNED) AS id FROM JSON_TABLE(lista_ids, "$[*]" COLUMNS (id INT PATH "$")) AS ids;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN lista_cursor;
    read_loop: LOOP
        FETCH lista_cursor INTO id_actual;
        IF done THEN
            LEAVE read_loop;
        END IF;

        WITH RECURSIVE red AS (
            SELECT id, host
            FROM users
            WHERE id = id_actual

            UNION ALL

            SELECT u.id, u.host
            FROM users u
            JOIN red ju ON u.host = ju.id
        )
        SELECT id_actual AS id_usuario_inicial, COUNT(*) AS total_usuarios
        FROM red;
    END LOOP;
    CLOSE lista_cursor;
END //
DELIMITER ;
